  false,\n\t\"url\": null,\n\t\"notes\": \"Data are from underwater visual surveys
  of fish stocks at 23 sites in West Hawaii. Survey sites are 8 to 14 m deep and are
  all located on reef shelves with moderate to high Porites compressa cover, the predominant
  habitat type at that depth on West Hawaii reefs, and the key habitat for the majority
  of fishes harvested for the aquarium trade. The survey program began as the West
  Hawaii Aquarium Project (WHAP) but since 2004 has continued as part of DAR's Main
  Hawaiian Islands Coral Reef Monitoring Program.\",\n\t\"license_title\": null,\n\t\"extras\":
